import React from 'react';
import { withStyles } from '@material-ui/core/styles';
import Rating from '@material-ui/lab/Rating';
import PanoramaFishEyeTwoToneIcon from '@material-ui/icons/PanoramaFishEyeTwoTone';
import Typography from '@material-ui/core/Typography';
import Box from '@material-ui/core/Box';

const StyledRating = withStyles({
    icon:{
        color: 'grey',
    },
  iconFilled: {
    color: '#B6C512',
    
  },
})(Rating);





export default function ScrRatingChart() {
  return (
    <div>
    
      <Box component="fieldset" mb={3} borderColor="transparent">
      <Typography component="legend" color="white" variant="subtitle2" >Marché 50%</Typography>
        <StyledRating
          name="customized-color"
          value={5.5}
          readOnly 
          max={10}  
          precision={0.5}
          icon={<PanoramaFishEyeTwoToneIcon fontSize="inherit" />}
        />
      </Box>

      <Box component="fieldset" mb={3} borderColor="transparent">
      <Typography component="legend" color="white" variant="subtitle2" >Marché 50%</Typography>
        <StyledRating
          name="customized-color"
          value={5.5}
          readOnly 
          max={10}  
          precision={0.5}
          icon={<PanoramaFishEyeTwoToneIcon fontSize="inherit" />}
        />
      </Box>

      <Box component="fieldset" mb={3} borderColor="transparent">
      <Typography component="legend" color="white" variant="subtitle2" >Marché 50%</Typography>
        <StyledRating
          name="customized-color"
          value={5.5}
          readOnly 
          max={10}  
          precision={0.5}
          icon={<PanoramaFishEyeTwoToneIcon fontSize="inherit" />}
        />
      </Box>

      <Box component="fieldset" mb={3} borderColor="transparent">
      <Typography component="legend" color="white" variant="subtitle2" >Marché 50%</Typography>
        <StyledRating
          name="customized-color"
          value={5.5}
          readOnly 
          max={10}  
          precision={0.5}
          icon={<PanoramaFishEyeTwoToneIcon fontSize="inherit" />}
        />
      </Box>

      <Box component="fieldset" mb={3} borderColor="transparent">
      <Typography component="legend" color="white" variant="subtitle2" >Marché 50%</Typography>
        <StyledRating
          name="customized-color"
          value={5.5}
          readOnly 
          max={10}  
          precision={0.5}
          icon={<PanoramaFishEyeTwoToneIcon fontSize="inherit" />}
        />
      </Box>
     
      
    </div>
  );
}
